import React from "react";
import Flashcard from "../components/Flashcard";

loadFlashcard = () => {
  API.getFlashcard()
    .then(res =>
      this.setState({ flashcard: res.data, section1: "", section2: "", section3: "" })
    )
    .catch(err => console.log(err));
};

state = {
  flashcards: [],
  flashcardName: "",
  flashcardImage: ""
};

function materials() {
  return (
    <div>
      <h1>My flashcards</h1>
      <Flashcard flashcardWord="Hello" flashcardImage="https://i.redd.it/l13irykatoz11.jpg" >
      </Flashcard>
    </div>
  );
}

export default materials;
